import React, { useContext, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { ThemeContext } from '../context/ThemeContext';
import { useAuth } from '../context/AuthContext';
import { supabase } from '../config/supabaseClient';
import { Auth } from '@supabase/auth-ui-react';
import { ThemeSupa } from '@supabase/auth-ui-shared';
import './Login.css';

const Login = () => {
  const navigate = useNavigate();
  const { theme } = useContext(ThemeContext);
  const auth = useAuth();
  const isDarkTheme = theme.palette.mode === 'dark';

  // Reindirizza se già autenticato
  useEffect(() => {
    if (auth.isAuthenticated && !auth.loading) {
      navigate('/');
    }
  }, [auth.isAuthenticated, auth.loading, navigate]);

  // Applica la classe di scope quando il componente viene montato
  useEffect(() => {
    document.body.classList.add('login-page-scope');

    // Rimuovi la classe quando il componente viene smontato
    return () => {
      document.body.classList.remove('login-page-scope');
    };
  }, []);

  if (auth.loading) {
    return (
      <div className="loading-container">
        <div className="loading-spinner"></div>
      </div>
    );
  }

  return (
    <div className={`auth-page ${isDarkTheme ? 'dark-theme' : ''}`}>
      {/* Decorative elements */}
      <div className="decoration decoration-1"></div>
      <div className="decoration decoration-2"></div>
      <div className="legal-pattern"></div>

      <div className="auth-layout">
        {/* Logo */}
        <div className="logo-container">
          <div className="logo">
            <span className="logo-embellishment top-right"></span>
            <div className="logo-main">VALIS</div>
            <span className="logo-embellishment bottom-left"></span>
          </div>
          <div className="logo-tagline">by Lexygraph AI</div>
        </div>

        {/* Main Authentication Container */}
        <div className="auth-container">
          {/* Auth UI Component di Supabase */}
          <Auth
            supabaseClient={supabase}
            appearance={{
              theme: ThemeSupa,
              variables: {
                default: {
                  colors: {
                    brand: isDarkTheme ? '#9A7CFF' : '#7C4DFF',
                    brandAccent: isDarkTheme ? '#B388FF' : '#6200EE',
                    brandButtonText: 'white',
                    defaultButtonBackground: isDarkTheme ? '#252545' : '#F0F4FA',
                    defaultButtonBackgroundHover: isDarkTheme ? '#1E1E3C' : '#E5E9F0',
                    inputBackground: isDarkTheme ? '#252545' : 'white',
                    inputBorder: isDarkTheme ? '#3D3D5C' : '#E6E6EF',
                    inputBorderHover: isDarkTheme ? '#7356E5' : '#7C4DFF',
                    inputBorderFocus: isDarkTheme ? '#9A7CFF' : '#6200EE',
                    inputText: isDarkTheme ? '#F3F4F6' : '#1E293B',
                    inputPlaceholder: isDarkTheme ? '#94A3B8' : '#94A3B8',
                  },
                  space: {
                    inputPadding: '14px 16px',
                    buttonPadding: '14px 16px',
                  },
                  radii: {
                    borderRadiusButton: '8px',
                    buttonBorderRadius: '8px',
                    inputBorderRadius: '8px',
                  },
                  fontSizes: {
                    baseBodySize: '16px',
                    baseInputSize: '16px',
                    baseLabelSize: '14px',
                    baseButtonSize: '16px',
                  },
                },
              },
              style: {
                container: { width: '100%', padding: '20px 40px 40px' },
                button: { fontWeight: '500' },
                anchor: { color: isDarkTheme ? '#9A7CFF' : '#7C4DFF' },
                message: { 
                  backgroundColor: isDarkTheme ? 'rgba(56, 161, 105, 0.08)' : 'rgba(56, 161, 105, 0.08)',
                  borderColor: isDarkTheme ? '#38A169' : '#38A169',
                  color: isDarkTheme ? '#F0FDF4' : '#166534',
                  padding: '12px 16px',
                  borderRadius: '8px'
                },
              }
            }}
            localization={{
              variables: {
                sign_in: {
                  email_label: 'Indirizzo email',
                  password_label: 'Password',
                  button_label: 'Accedi',
                  loading_button_label: 'Accesso in corso...',
                  link_text: 'Hai già un account? Accedi',
                  social_provider_text: 'Accedi con {{provider}}',
                },
                sign_up: {
                  email_label: 'Indirizzo email',
                  password_label: 'Password',
                  button_label: 'Registrati',
                  loading_button_label: 'Registrazione in corso...',
                  link_text: 'Non hai un account? Registrati',
                  social_provider_text: 'Registrati con {{provider}}',
                },
                forgotten_password: {
                  email_label: 'Indirizzo email',
                  password_label: 'Password',
                  button_label: 'Invia istruzioni',
                  loading_button_label: 'Invio istruzioni in corso...',
                  link_text: 'Hai dimenticato la password?',
                  confirmation_text: 'Controlla la tua email per il link di reset password',
                },
              },
            }}
            providers={['google']}
            socialLayout="horizontal"
            redirectTo={window.location.origin}
          />
        </div>
      </div>
    </div>
  );
};

export default Login;
